import React, { Component } from "react";


class Register extends Component{

    render() {
        return (
            <React.Fragment>
                <div className="display-1 registerContainer">
                    <p className="display-1">Hello from loginContainer</p>
                </div>
            </React.Fragment>
        );
    }
}
export default Register;
